text:
@Orchestrative Pertanyaan teknis: Ini DNS-over-HTTPS, atau DNS-over-TLS ?

DNS-over-TLS masih bisa di block (kalau Kominfo nekat) dengan block port 53 di seluruh ISP. 
DNS-over-HTTPS sangat susah di block karena lewat port nya https bercampur dengan semua traffic internet.

en_text:
@Orchestrative Technical Questions: This is DNS-Over-HTTPS, or DNS-Over-TLS?

DNS-Over-TLS can still be blocked (if Kominfo is desperate) with a block port 53 throughout the ISP.
DNS-Over-HTTPS is very difficult to block because through its port HTTPS mixed with all internet traffic.

